import React from "react";
import { useParams } from "react-router-dom";

const WorkoutPlan = () => {
  const { date } = useParams();
  return (
    <div>

      <h2 >Workout Plan for {date}</h2>
    </div>
  );
};

export default WorkoutPlan;
